import React from "react";

export function AboutPage() {
    return (
        <div>
            <h1><center>
                About us</center>
            </h1>
            <div>
                Welcome to our store, where your shopping experience is our top priority! Founded with a passion for quality products and exceptional customer service.
            </div>
        </div>
    )
}
